import React, { useState, useEffect } from 'react';


const Portfolio = props => {

    return (
        <div>
            <table className="table table-bordered">
                <thead>
                    <tr>
                        <th>{props.stockName}</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>Price</td>
                        <td>{props.price}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}
 
export default Portfolio;
